import React from "react";

const wrapperStyle = {
	position: "absolute",
	width: "100%"
}
const gradientStyle = {
	backgroundImage: "background: linear-gradient(to bottom, #000000 0%,#45484d 100%);"
}

export default function HeroVideo(props) {
	return (
		<div className="wrapper">
			<div className="gradient" />
			<div className="hero">
				<video className="hero-content media" autoPlay="autoplay" muted loop>
					<source src={props.src} type="video/mp4" />
				</video>
			</div>
		</div>
	);
}
